import NavRight from "./components/NavRight";
import { restoreCSRF, restoreCurrentUser } from "./store/csrf";

function App() {
  if (sessionStorage.getItem('X-CSRF-Token')=== null){
    restoreCSRF();
  }
  if (sessionStorage.getItem('current-user') === null) {
    restoreCurrentUser();
  }
  return (
    <div className="App">
      <NavBar />
      <div className="main-content">
      {/* <NavRight /> */}
      </div>
    </div>
  );
}

export default App;
